    [],nt"revision_timestamp": "2016-07-27T22:56:33.770875",nt"name": "potential-for-contaminant-exposure-to-bald-eagles-of-the-james-river-1993",nt"isopen":
    false,nt"url": null,nt"notes": "The James River, Virginia has one of the
    largest concentrations of bald eagles on the east coast of the United States. Effects
    of environmental contaminants upon bald eagles have been of great concern since
    the use of DDT was linked to the bald eagle decline in the 1960s. This study set
    out to determine if fish of the James River were contaminated. Contaminant concentrations
    in fish were then evaluated as to whether they posed a potential threat to bald
    eagles in the James River concentration area as fish constitute up to 90% of the
    diet of eagles in this area.",nt"license_title": "License Not Specified",nt"extras":
